  02> MACKIE, Charles Jefferd
  b 19.09.1983
  Charles b. at Gisborne. He was a student at Te Wharau Primary School and Hereworth School and
  is now at King's College, Auckland.
  05>' BUSBY, George Alexander m on 23.02.1909 to WATERHOUSE, Dorothy Blanche
  b 01.05.1881 d ** ** 1926
  b 18.05.1887 d 11.12.1953
  George b. at Ngaheia. He was a farmer on "Pauariki" station at Tokomaru Bay. He died at sea on the way home
  from a visit to England. Dorothy was a clever cartoonist and writer of children's stories.
  01> BUSBY, William Richard (Dick)
  b 24.05.1910 d 23.11.1941
  Dick farmed at Pauariki where he had a Romney stud flock. He was killed in action at Sidi Resegh in the
  Western Desert during WW2.
  02> BUSBY, Beatrice
  b ** **.1911 d ** ** 1922
  Beatrice d. of diabetes at the age of 11 years.
  03> BUSBY, Mary Dorothy (Molly) m on ** ** 1947 to COWAN, James Linburn
  b 28.12.1914 d 17.12.1970
  b 08.01.1916 d 24.06.1990
  Molly was a keen sportswoman. She served as a land girl during ww2.
  01> COWAN, Elizabeth Mary m on ** ** **** to NAIRN. Stuart John
  b 26.08.1953
  b ** ** ****
